// File: demo-app/src/main/java/tiktok/knit/sample/Another.kt
@Provides(IAnother::class)
@Singleton
class Another : IAnother {
    override fun call(): String {
        return "foo"
    }
}

// File: demo-app/src/main/java/tiktok/knit/sample/Another.kt
@Component
class AA {
    @Provides(IAnother::class) val another: Another = Another()
}

// File: demo-app/src/main/java/tiktok/knit/sample/MainActivity.kt
class MainActivity : Activity() {

    @Component
    val aa = AA()

    @Provides
    fun providesOwner1(): @Named("sss") String {
        return "Hello World"
    }

    @Provides
    fun providesOwner2(): String {
        return "Hello World"
    }

    private val strInjected: String by di

    private val owner: Loadable<String> by di

    private val another: IAnother by di

    private val loadableAnother: Loadable<IAnother> by di

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        val tv = TextView(this)
        setContentView(tv)
        tv.text = """
                another: $another,
                strInjected: $strInjected,
                owner: $owner,
            """.trimIndent()
        owner.load()
        owner.get()
        owner.unload()
    }
}
